class dyno extends StatelessWidget {
  final String? chatmesage;
  final String? chattitle;
  final Color? seenstatus;
  final String? imageUrl;

  const dyno(
      {super.key,
      this.chatmesage,
      this.chattitle,
      this.seenstatus,
      this.imageUrl
      });

  @override
  Widget build(BuildContext context) {
    return Row(
      children: [
        CircleAvatar(
          radius: 30,
          backgroundImage: NetworkImage(imageUrl!),
        ),
        Expanded(
            child: ListTile(
          title: Text(
            '$chattitle',
            style: const TextStyle(fontWeight: FontWeight.w600),
          ),
          subtitle: Row(
            children: [
              Icon(
                seenstatus == Colors.blue ? Icons.done : Icons.done,
                size: 15,
                color: seenstatus,
              ),
              Expanded(
                  child: Padding(
                padding: EdgeInsets.only(left: 6.0),
                child: Text(
                  '$chatmesage',
                  style: TextStyle(overflow: TextOverflow.ellipsis),
                ),
              ))
            ],
          ),
              trailing: Column(
                children: [
                  Padding(padding: EdgeInsets.only(top: 8.0),
                  child: Text('Yesterday'),)
                ],
              ),
        )),
      ],
    );
  }
}
